  <script>
    $(function() {
      var hashData = function(name) {
        return decodeURIComponent(window.location.hash.split('&' + name + '=')[1].split('&')[0]);
      };
      
      parent.parent.luminateExtend.api.request.hashTransportEventHandler.handler(hashData('hashTransportFrameId'), $.parseJSON(hashData('responseData')));
    });
  </script>
